★ニューバランスのキッズシューズ！<br>
<br>
●紐部分をゴムシューレースを用いることで脱ぎ履きしやすいスリッポン構造になりました！<br>
●ソールのクッション性も抜群で、たくさん走り回るお子様にもおすすめ！<br>
●かかとにも厚めのクッションがあり、動きにフィットしてくれます。<br>
●屈曲性と軽量性に優れたプレマスソールが裸足感覚のナチュラルな履き心地を提供。<br>
<br>
■素材<br>
甲：人工皮革、合成繊維<br>
底：ゴム底(アウトソール)、合成底(ミッドソール)<br>
■企画製造販売元　株式会社ニューバランス ジャパン<br>
<br>
