★ニューバランスのキッズシューズ！<br>
<br>
●レトロランニングを思わせる色調デザイン！<br>
●ソールのクッション性も抜群で、たくさん走り回るお子様にもおすすめです。<br>
●かかとにも厚めのクッションがあり、動きにフィットしてくれます。<br>
●フロント部分は２本のベルクロストラップタイプなのでフィット感が良く、着脱も簡単です！<br>
<br>
■素材<br>
甲皮の使用材：人工皮革、合成繊維<br>
底材の種類：ゴム底(アウトソール)、合成底(ミッドソール)<br>
■企画製造販売元　株式会社ニューバランス ジャパン<br>
